/* Default Settings Submit 1.0.2 */
(function($){$(document).ready(function(){if(!_canLoad()){return}
_debugLog('Submit Script',aalSubmit);$('.reset-defaults').click(function(event){$('.submit-warning-reset').remove();if(!$('input.reset-confirm[type=checkbox]').prop('checked')){event.preventDefault();$(this).closest('.amazon-auto-links-fieldset').closest('.amazon-auto-links-fields').append('<span class="warning submit-warning-reset">* '+aalSubmit.label.please_confirm+'</span>')
return!1}
return!0})});function _debugLog(...args){if(!parseInt(aalSubmit.debugMode)){return}
console.log(aalSubmit.pluginName,...args)}
function _canLoad(){if('undefined'===typeof aalSubmit){console.log('The submit script is not loaded.');return!1}
return!0}}(jQuery))